import React from "react";
import "./style.css";

function Hero(props) {
  return (
    <section class="hero is-medium is-primary is-bold">
      <div class="hero-body">
        <div class="container">
          <h1 class="title">Dog Clicky Game!</h1>
          <h2 class="subtitle">Click an image of a dog only once, and test your memory!</h2>
        </div>
      </div>
    </section>
  );
}
export default Hero;
